import React from 'react';

const PatientModel = (props) => {
    console.log(props.patientData[props.patientNumber - 1])

    props.patientData.forEach((element) => {

        if(props.patientNumber === element.patientnumber){
            console.log('here is the data')
        }
    });

    return (
        <div>
            <div className="modal fade" id="modalPush" tabIndex="-1" role="dialog" aria-labelledby="exampleModalLabel"
                aria-hidden="true">
                <div className="modal-dialog modal-notify modal-info" role="document">
                    <div className="modal-content text-center">
                        <div className="modal-header d-flex justify-content-center">
                            <p className="heading">Patient Number : {props.patientNumber}</p>
                        </div>

                        <div className="modal-body">
                            {/* patient details here */}
                            <p>Detected City : {props.detectedCity}</p>
                        </div>
                    </div>
                </div>
            </div>

        </div>
    )
}

export default PatientModel
